import axios from 'axios';
import React, { useEffect, useState }from 'react';
import './App.css';

function App() {
  const [albums, setAlbums] = useState('');
useEffect(()=>{
  axios.get("http://localhost:3333/albums")
  .then(res => setAlbums(res.data));


}, [])
  return (
    <div className="App">
      <ul>
        {albums.map(album => (
          <li key={album.id}>
            <p>{album.id}-{album.name}</p>
          </li>
        ))}
      </ul>

    </div>
  );
}

export default App;
